import './App.css';

//import { useState } from "react";
import default_lat from './config/config.js';
//import default_lon from './config/config.js';
//import CONFIG from './config/config.js';

function App() {

  //const [default_lat,setLat] = useState("");

  return (
    <div className="App">
      <header className="App-header">
        <h2 id='titulo'>El tiempo</h2>
        <div id='cabecera'>
        <img src={logo} className="logo" alt="logo" />
        <h3 className='mensaje'>Bienvenido a la página de Álvaro Torroba de Linos</h3>
        </div>
        <input id='latitud' value={default_lat.default_lat}/>
        <input id='longitud' value={-3.703790}/>
        <button id='buscar'>Buscar</button>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
